import React from "react";

export default function Question(props) {
    let AllQuestion = props.quiz
    AllQuestion.map(que => {
        return (
            <div>
                <h2>{que.question}</h2>
                <p>{que.correctAnswer}</p>
            </div>
        )
    })


    return (
        {AllQuestion}
    )
}
